Description:
Mình cần tuyển một bạn iOS/Flutter developer, có kinh nghiệm về cào dữ liệu càng tốt. 
Yêu cầu: viết app iOS cho người dùng đăng nhập vào Google, sau đó sẽ lấy dữ liệu về các video YouTube đã xem của người dùng. Đây chỉ là app demo nhỏ, không yêu cầu giao diện. 
Ví dụ về data: 
[ 
{ 
"title": "Youtube title 1", 
"titleUrl": "[https://www.youtube.com/watch?v\\u003dxyza](https://www.youtube.com/watch?v%5C%5Cu003dxyza)", 
"time": "2022-10-08T11:15:59.687Z", 
}, 
{ 
"title": "Youtube title 2", 
"titleUrl": "[https://www.youtube.com/watch?v\\u003dxyza](https://www.youtube.com/watch?v%5C%5Cu003dxyza)", 
"time": "2022-10-08T11:15:59.687Z", 
}, 
{ 
"title": "Youtube title 3”, 
"titleUrl": "[https://www.youtube.com/watch?v\\u003dxyza](https://www.youtube.com/watch?v%5C%5Cu003dxyza)", 
"time": "2022-10-08T11:15:59.687Z", 
}, 
] 
Mình tự nghiên cứu thì có 2 cách để lấy video Youtube đã xem: 1 là cào trên Google MyActivity. 2 là download ở Google Takeout. Bạn dùng cách nào cũng được, hoặc đề xuất giải pháp tối ưu hơn. 
Mình không đặt nặng công nghệ. Bạn có thể làm native hoặc flutter… Thời gian linh hoạt. 
Xin cảm ơn!
